import React, { useState, useEffect } from 'react';

function App() {
  const [error, setError] = useState();
  const [isLoaded, setIsLoaded] = useState(false);
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetch('https://randomuser.me/api/?results=1000&inc=name,dob,picture')
      .then((res) => res.json())
      .then(
        (result) => {
          setIsLoaded(true);
          setItems(result);
        },

        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      );
  }, []);

  if (error || !Array.isArray(items)) {
    return <div>Error: {error.message}</div>;
  } else if (!isLoaded) {
    return <div>Loading...</div>;
  } else {
    const people = items.results;
    console.log(people, items.results);
    return (
      <main>
        <section className="container">
          <h3>birthdays today</h3>
          {/* <List people={people} /> */}

          {/* <button onClick={() => setPeople([])}>Clear All</button> */}
        </section>
      </main>
      //   {/* <ul>
      //     {items.map(item => (
      //       <li key={item.id}>
      //         {item.name} {item.price}
      //       </li>
      //     ))}
      //   </ul> */}
    );
  }
}

export default App;
